def make_plot(xlabel, ylabel, dictkey, figname):
    plt.clf()
    plt.xlabel(xlabel)
    plt.ylabel(ylabel)


    for i in range(len(labels)):
        dict_list = results_list[i]
        results = []
        for d in dict_list:
            results.append(np.array(d[dictkey][:n_epochs]))

        for x in results:
            print(x.shape)

        to_plot = np.stack(results)
        # print(to_plot.shape)

        last, conf_bound = plot_with_conf_bounds(
            np.array(to_plot),
            x_range,
            label=labels[i],
            color=color_list[i],
            linestyle=linestyle_list[i],
        )

    # plt.legend(loc='upper right', bbox_to_anchor=(1, 0.6), fontsize=7)
    plt.legend()
    plt.savefig(figname)

def make_frontier(xlabel, ylabel, dictkey_x, dictkey_y, figname):
    plt.clf()
    plt.xlabel(xlabel)
    plt.ylabel(ylabel)

    for i in range(len(labels)):
        dict_list = results_list[i]
        x_results = []
        y_results = []
        for d in dict_list:
            # Take last result
            x_results.append(np.array(d[dictkey_x][n_epochs - 1]))
            y_results.append(np.array(d[dictkey_y][n_epochs - 1]))

        to_plot_x = np.stack(x_results)
        to_plot_y = np.stack(y_results)

        # print(to_plot.shape)

        plt.scatter(to_plot_x, to_plot_y, label=labels[i], c=color_list[i])

    # plt.legend(loc='upper right', bbox_to_anchor=(1, 0.6), fontsize=7)
    plt.legend()
    plt.savefig(figname)

